import { Injectable } from '@angular/core';
import { UrlSegment } from '@angular/router';

@Injectable({
  providedIn: 'root'
})
export class RouteMatcherService {

  constructor() { }

  static isBaseDir(segments: UrlSegment[]): any {
  if (segments.length === 2)
    return { consumed: segments, posParams: {} };
  else
    return null;
  }

}
